### Code Snippet 1: Vulnerable Code

```java
// This code is vulnerable because it directly accesses the database without any parameterized queries or prepared statements.
String sql = "SELECT * FROM users WHERE username = '" + user.getUsername() + "'"; 
Statement stmt = conn.createStatement();
ResultSet rs = stmt.executeQuery(sql);
```

### Code Snippet 2: Fixed Code

```java
// This code is fixed by using a PreparedStatement which helps prevent SQL injection attacks.
String sql = "SELECT * FROM users WHERE username = ?";
try (PreparedStatement pstmt = conn.prepareStatement(sql)) {
    pstmt.setString(1, user.getUsername());
    ResultSet rs = pstmt.executeQuery();
}
```

In the first snippet, the code is vulnerable because it uses string concatenation to build the SQL query. This can lead to SQL injection attacks if `user.getUsername()` returns unexpected values. In the second snippet, a PreparedStatement is used instead. This method binds parameters separately from the SQL statement, making it much harder for an attacker to inject malicious SQL code.

